import logo from '../../images/logo01.svg'
import './style.css'

function Logo() {
    return (
        <div className='App-logo'>
            <img src={logo} className='Logo-img'></img>
            <p><strong>MoveX</strong></p>
        </div>
    )
}

export default Logo;
